    "class BokehPlot:\n",
    "    '''Plot using bokeh'''\n",
    "    def __init__(self):\n",
    "        self.indicators = ['Money Flow', 'MACD Line', 'RSI', 'Stochastic Oscillator %K', 'CCI']\n",
